const CANVAS_WIDTH = 40;
const CANVAS_HEIGHT = 22;
const DEFAULT_LOOP = true;

export const FlamesAscii: React.FC<AsciiMotionCliProps> = ({
  hasDarkBackground = true,
  autoPlay = true,
  loop = DEFAULT_LOOP,
  onReady,
  maxRows,
  mirror = false,
  maxWidth,
}) => {
  const [frameIndex, setFrameIndex] = useState(0);
  const [isPlaying, setIsPlaying] = useState(autoPlay);
  const frameElapsedRef = useRef(0);
  const lastTimestampRef = useRef(Date.now());

  // Select color theme based on background
  const theme = useMemo(
    () => (hasDarkBackground ? THEME_DARK : THEME_LIGHT),
    [hasDarkBackground]
  );
  const getColor = useCallback(
    (key: string): string => theme[key] || key,
    [theme]
  );
  const defaultFg = hasDarkBackground ? "white" : "black";

  const play = useCallback(() => setIsPlaying(true), []);
  const pause = useCallback(() => setIsPlaying(false), []);
  const restart = useCallback(() => {
    setFrameIndex(0);
    frameElapsedRef.current = 0;
    lastTimestampRef.current = Date.now();
    setIsPlaying(true);
  }, []);

  useEffect(() => {
    if (onReady) {
      onReady({ play, pause, restart });
    }
  }, [onReady, play, pause, restart]);

  useEffect(() => {
    if (!isPlaying || FRAMES.length <= 1) return;

    const interval = setInterval(() => {
      const now = Date.now();
      const delta = now - lastTimestampRef.current;
      lastTimestampRef.current = now;
      frameElapsedRef.current += delta;

      const currentFrame = FRAMES[frameIndex];
      if (frameElapsedRef.current >= currentFrame.duration) {
        frameElapsedRef.current = 0;
        const nextIndex = frameIndex + 1;
        if (nextIndex >= FRAMES.length) {
          if (loop) {
            setFrameIndex(0);
          } else {
            setIsPlaying(false);
          }
        } else {
          setFrameIndex(nextIndex);
        }
      }
    }, 16);

    return () => clearInterval(interval);
  }, [isPlaying, frameIndex, loop]);

  const frame = FRAMES[frameIndex];

  // Apply row limiting (show bottom N rows of flame)
  const startRow =
    maxRows && maxRows < CANVAS_HEIGHT ? CANVAS_HEIGHT - maxRows : 0;
  const visibleContent = frame.content.slice(startRow);

  return (
    <Box flexDirection="column">
      {visibleContent.map((row, visibleY) => {
        const originalY = visibleY + startRow;
        // Trim width: take center portion of flame (content is centered in canvas)
        let displayRow = row;
        let sliceStart = 0;
        if (maxWidth && maxWidth < CANVAS_WIDTH) {
          // Center the slice on the flame content (centered at col 20)
          sliceStart = Math.floor((CANVAS_WIDTH - maxWidth) / 2);
          displayRow = row.slice(sliceStart, sliceStart + maxWidth);
        }

        // Apply horizontal mirroring
        const chars = displayRow.split("");
        if (mirror) {
          chars.reverse();
        }

        return (
          <Box key={`flame-row-${visibleY}`}>
            {chars.map((char, displayX) => {
              // Calculate original X position for color lookup
              let originalX: number;
              if (mirror) {
                // After reversing, displayX 0 corresponds to the last char of the slice
                originalX = sliceStart + (chars.length - 1 - displayX);
              } else {
                originalX = sliceStart + displayX;
              }

              const posKey = `${originalX},${originalY}`;
              const fg = frame.fgColors[posKey]
                ? getColor(frame.fgColors[posKey])
                : defaultFg;
              const bg = frame.bgColors[posKey]
                ? getColor(frame.bgColors[posKey])
                : undefined;
              return (
                <Text
                  key={`flame-char-${displayX}`}
                  color={fg}
                  backgroundColor={bg}
                >
                  {char}
                </Text>
              );
            })}
          </Box>
        );
      })}
    </Box>
  );
};

export default FlamesAscii;
